    return ( 
        <>
        <Hero />
        <LeftSection imgURL="/media/images/products-kite.png" productName="Kite" productDescription="Our ultra-fast flagship trading platform with streaming market data, advanced charts, an elegant UI, and more. Enjoy the Kite experience seamlessly on your Android and iOS devices." tryDemo="Try Demo" learn="Learn more" googlePlay="" appStore="" />
        <RightSection />
        <Universe />
        </>
     );
}

export default ProductsPage;
